('1765','7','9139','GS II Gamundi',Null,'Baugrundstück am Golfplatz Son Antem in Lluchmajor','21275','15.000 m² werden per Escritura verkauft um eine Baugenehmigung zu erhalten.\r\nErstellt werden kann ein Haus mit 493 m² Wohnfläche auf 2 Etagen.\r\nEine Trink-Wasserquelle mit 38.000 l / Std. ist nicht im Preis enthalten und wird nicht mitverkauft. Ca 2.500 m²  des Grundstückes mit der Quelle werden abgetrennt und bleiben im Besitz des Verkäufers. \r\nWasser von diesem Brunnen für den Eigenbedarf kann für ca. 800 € im Jahr gekauft, oder für einen kommerziellen Wasservertrieb gepachtet werden.\r\nDie Pacht beträgt für das 1. Jahr 450 € / monatlich und nach  dem 1. Jahr 900€ / mtl.','21276','175000','111','2012-03-06 15:45:05','106','2012-03-06 15:45:14',Null,'1343','98','654',1,'1','0',Null,Null,Null,'21277',Null,'0','0','0',Null,'2015-04-15 16:42:57',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'21278',Null,'21279',Null,'21280',Null,'21281',Null,'21282','0',0,'0');
